import style from './card.module.css';
export default function Card({ name,image,species,gender,origin,status}) {
   return (
      <div className={style.card}>
         <div classname={style.incard}>
            <button onClick={() =>  window.alert('Emulamos que se cierra la card')} className={style.buttonx}>X</button>
            <br></br>
            <br></br>
            <img src={image} alt='Img' />
            <h2>Nombre: {name}</h2>
            <h2>Especie: {species}</h2>
            <h2>Genero: {gender}</h2>
            <h2>Origen: {origin}</h2>
            <h2>Status: {status}</h2>
         </div>
      </div>
   );
}
